        long result = operand.get(0);
        for (int i = 0; i < len; i++) {
            switch (op.get(i)) {
                case "+":
                    result += operand.get(i + 1);
                    break;
                case "-":
                    result -= operand.get(i + 1);
                    break;
                case "*":
                    result *= operand.get(i + 1);
                    break;
                case "//":
                    result = result / operand.get(i + 1);
                    break;
                case "**":
                    result = (long) Math.pow(result, operand.get(i + 1));
                    break;
            }
        }
        return result;

