        long firstPrime = 2;
        long lastPrime = n - 1;
        // an array list to store all primes from firstPrime to lastPrime
        ArrayList<Long> primes = new ArrayList<Long>();
        // add firstPrime to primes
        primes.add(firstPrime);
        // the firstPrime is the smallest prime number
        long prime = firstPrime;
        // try to find next prime number
        long number = prime + 1;
        while (number <= lastPrime) {
            // if number is not divisible by any prime, then it is also a prime
            boolean isDivisible = false;
            for (long p : primes) {
                if (number % p == 0) {
                    isDivisible = true;
                    break;
                }
            }
            if (!isDivisible) {
                // add number to primes
                primes.add(number);
                // update prime
                prime = number;
            }
            // try the next number
            number++;
        }
        return primes;

