        primes.add(2l);
        ArrayList<Long> possiblePrimes = new ArrayList<Long>();
        for(long i = 3; i < n; i += 2){
            possiblePrimes.add(i);
        }
        long curr = 3;
        while(!possiblePrimes.isEmpty()){
            ArrayList<Long> possiblePrimesCpy = new ArrayList<Long>(possiblePrimes);
            for(long i = curr; i < n; i += 2){
